def test_retrieval(retrieval_object, method_name):
    error_message = ""
    for i in xrange(5):
        try:
            getattr(retrieval_object, method_name)()
            return "Success"
        except Exception as e:
            error_message = e.message
        time.sleep(2)

    return error_message

